import React  from "react";
import Footer from "./containers/Footer/Footer";
import Help from "./containers/Help/Help";
import ToDo from "./containers/ToDo/ToDo";
import Support from "./containers/Support/Support";
import History from "./containers/History/History";
import Statistics from "./containers/Statistics/Statistics";
import Repressions from "./containers/Repressions/Repressions";
import SpreadInfo from "./containers/SpreadInfo/SpreadInfo";
import Check from "./containers/Check/Check";
import Cooperate from "./containers/Cooperate/Cooperate";
import Main from "./containers/Main/Main";

function CreateContext() {
const [data, setData] = useState([]);
const getData = () => {
  fetch("data.json", {
    headers: {
      "Content-Type": "application/json",
      Accept: "application/json",
    },
  })
    .then(function (response) {
      console.log(response);
      return response.json();
    })
    .then(function (myJson) {
      console.log(myJson);
      setData(myJson);
    });
};
useEffect(() => {
  getData();
}, []);
}

function App() {


  const Context = React.createContext([]);

  return (
    <Context.Provider value={[]}>
      <Main />
      <Cooperate />
      <Check />
      <SpreadInfo />
      <Repressions />
      <Statistics />
      <History />
      <Support />
      <ToDo />
      <Help />
      <Footer />
    </Context.Provider>
  );
}

export default App;
